import React from 'react';



const ToDoList = () => {
    return(
        <>
            <div className='main_div'>
                <div className='center_div'>
                    <h1> 0 </h1>
                    <div className='btn_div'>
                        <button> Inc </button>
                        <button> Dec </button>
                    </div>
                </div>
            </div>
        </>
    );
}

export default ToDoList;
